definition:
Existence everywhere, or in places, at the same time;
   omnipresence; as, the ubiquity of God is not disputed by those who
   admit his existence.

Situated beyond, or outside of, the tropics;
   extratropical; also, having an excessively tropical temperature; warmer
   than the tropics.

Lying outside the visible spectrum at its violet end;
   -- said of rays more refrangible than the extreme violet rays of the
   spectrum.

A slight, navel-like depression, or dimpling, of the
   center of a rounded body; as, the umbilication of a smallpox vesicle;
   also, the condition of being umbilicated.

The feeling of being overshadowed; jealousy of another, as
   standing in one's light or way; hence, suspicion of injury or wrong;
   offense; resentment.

Not absorbable; specifically (Physiol.), not capable
   of absorption; unable to pass by osmosis into the circulating blood;
   as, the unabsorbable portion of food.

Not assuming; not bold or forward; not arrogant or
   presuming; humble; modest; retiring; as, an unassuming youth;
   unassuming manners.

Believing the thing alleged no to be true;
   disbelieving; especially, believing that Bible is not a divine
   revelation, or that Christ was not a divine or a supernatural person.

To remove a band from; to set free from shackles or
   fastenings; to unite; to unfasten; to loose; as, unbind your fillets;
   to unbind a prisoner's arms; to unbind a load.

Not common; unusual; infrequent; rare; hence, remarkable;
   strange; as, an uncommon season; an uncommon degree of cold or heat;
   uncommon courage.

Not conscionable; not conforming to reason;
   unreasonable; exceeding the limits of any reasonable claim or
   expectation; inordinate; as, an unconscionable person or demand;
   unconscionable size.

Not cut; not separated or divided by cutting or otherwise;
   -- said especially of books, periodicals, and the like, when the leaves
   have not been separated by trimming in binding.

Lower in position, intensity, rank, or degree; subject;
   subordinate; -- generally in composition with a noun, and written with
   or without the hyphen; as, an undercurrent; undertone; underdose;
   under-garment; underofficer; undersheriff.

The act of one who understands a thing, in any sense
   of the verb; knowledge; discernment; comprehension; interpretation;
   explanation.

To be apprised, or have information, of; to learn;
   to be informed of; to hear; as, I understand that Congress has passed
   the bill.

Not agreeable to a rule or standard, or to duty;
   disproportioned; excessive; immoderate; inordinate; as, an undue
   attachment to forms; an undue rigor in the execution of law.

The act of undulating; a waving motion or vibration;
   as, the undulations of a fluid, of water, or of air; the undulations of
   sound.

Not equaled; unmatched; unparalleled; unrivaled;
   exceeding; surpassing; -- in a good or bad sense; as, unequaled
   excellence; unequaled ingratitude or baseness.

Not liable to any exception or objection;
   unobjectionable; faultless; good; excellent; as, a man of most
   unexceptionable character.

Not faithful; not observant of promises, vows,
   allegiance, or duty; violating trust or confidence; treacherous;
   perfidious; as, an unfaithful subject; an unfaithful agent or servant.

Not finished, not brought to an end; imperfect;
   incomplete; left in the rough; wanting the last hand or touch; as, an
   unfinished house; an unfinished picture; an unfinished iron casting.

Not fortunate; unsuccessful; not prosperous; unlucky;
   attended with misfortune; unhappy; as, an unfortunate adventure; an
   unfortunate man; an unfortunate commander; unfortunate business.

Not producing fruit or offspring; unproductive;
   infertile; barren; sterile; as, an unfruitful tree or animal;
   unfruitful soil; an unfruitful life or effort.

Not graceful; not marked with ease and dignity;
   deficient in beauty and elegance; inelegant; awkward; as, ungraceful
   manners; ungraceful speech.

Not grateful; not thankful for favors; making no
   returns, or making ill return for kindness, attention, etc.;
   ingrateful.

Wanting noble or amiable qualities; dishonorable;
   illiberal; low; disingenuous; mean; indecorous; as, unhandsome conduct,
   treatment, or imputations.

Not granted an audience or a hearing; not allowed to
   speak; not having made a defense, or stated one's side of a question;
   disregarded; unheeded; as, to condem/ a man unheard.

In a uniform manner; without variation or diversity;
   by a regular, constant, or common ratio of change; with even tenor; as,
   a temper uniformly mild.

Not impeachable; not to be called in question;
   exempt from liability to accusation; free from stain, guilt, or fault;
   irreproachable; blameless; as, an unimpeachable reputation;
   unimpeachable testimony.

Not used; not employed; especially, not used or
   employed for a valuable purpose; as, unimproved opportunities;
   unimproved blessings.

The act of uniting or joining two or more things into one,
   or the state of being united or joined; junction; coalition;
   combination.

Of or pertaining to the universe; extending to,
   including, or affecting, the whole number, quantity, or space;
   unlimited; general; all-reaching; all-pervading; as, universal ruin;
   universal good; universal benevolence or benefice.

Not lucky; not successful; unfortunate; ill-fated;
   unhappy; as, an unlucky man; an unlucky adventure; an unlucky throw of
   dice; an unlucky game.

Having no moral perception, quality, or relation;
   involving no idea of morality; -- distinguished from both moral and
   immoral.

Having no precedent or example; not preceded by a
   like case; not having the authority of prior example; novel; new;
   unexampled.

Not submissive to rule; disregarding restraint;
   disposed to violate; turbulent; ungovernable; refractory; as, an unruly
   boy; unruly boy; unruly conduct.

To deprive of sex, or of qualities becoming to one's sex;
   esp., to make unfeminine in character, manners, duties, or the like;
   as, to unsex a woman.

Aloft; on high; in a direction contrary to that of gravity;
   toward or in a higher place or position; above; -- the opposite of
   down.

To or in a state of completion; completely; wholly; quite;
   as, in the phrases to eat up; to drink up; to burn up; to sum up; etc.;
   to shut up the eyes or the mouth; to sew up a rent.

In a direction from lower to higher; toward a higher
   place; in a course toward the source or origin; -- opposed to downward;
   as, to tend or roll upward.

Pertaining to, resembling, or containing uranium;
   specifically, designating those compounds in which uranium has a
   valence relatively higher than in uranous compounds.

To present in an urgent manner; to press upon attention;
   to insist upon; as, to urge an argument; to urge the necessity of a
   case.

The act of using; mode of using or treating; treatment;
   conduct with respect to a person or a thing; as, good usage; ill usage;
   hard usage.

The special form of ritual adopted for use in any diocese;
   as, the Sarum, or Canterbury, use; the Hereford use; the York use; the
   Roman use; etc.

To accustom; to habituate; to render familiar by practice;
   to inure; -- employed chiefly in the passive participle; as, men used
   to cold and hunger; soldiers used to hardships and danger.

To be wont or accustomed; to be in the habit or practice;
   as, he used to ride daily; -- now disused in the present tense, perhaps
   because of the similarity in sound, between "use to," and "used to."

Such as is in common use; such as occurs in ordinary
   practice, or in the ordinary course of events; customary; ordinary;
   habitual; common.

That which is used; an instrument; an implement;
   especially, an instrument or vessel used in a kitchen, or in domestic
   and farming business.

Of or pertaining to utility; consisting in utility;
   /iming at utility as distinguished from beauty, ornament, etc.;
   sometimes, reproachfully, evincing, or characterized by, a regard for
   utility of a lower kind, or marked by a sordid spirit; as, utilitarian
   narrowness; a utilitarian indifference to art.

To make useful; to turn to profitable account or use;
   to make use of; as, to utilize the whole power of a machine; to utilize
   one's opportunities.

Situated at the farthest point or extremity; farthest out;
   most distant; extreme; as, the utmost limits of the land; the utmost
   extent of human knowledge.

Being in the greatest or highest degree, quantity, number,
   or the like; greatest; as, the utmost assiduity; the utmost harmony;
   the utmost misery or happiness.
